(1, 'দাম কমল ধানের, চাল চড়াই রইল', 'দাম-কমল-ধানের,-চাল-চড়াই-রইল', '1', '-2020-12-29-5feb067408b1b.jpg', '<p style=\"margin-bottom: var(--space2); padding: 0px; font-family: Shurjo, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 1.8rem; line-height: 1.67; white-space: break-spaces; color: rgb(18, 18, 18);\">নওগাঁর নিয়ামতপুর উপজেলার গোবিন্দপুর গ্রামের কৃষক ফিরোজ হোসেন গতকাল সোমবার সকালে স্থানীয় ছাতড়া বাজারে ধান নিয়ে গিয়েছিলেন বিক্রি করতে। তিনি জানান, আগের দিন খবর নিয়ে তিনি জেনেছিলেন মোটা ধানের মণপ্রতি দর ১ হাজার ৬০ টাকার মতো। পরদিন অর্থাৎ গতকাল সকালে বাজারে গিয়ে দেখেন এক দিনেই দাম কমেছে মণে প্রায় ১০০ টাকা।</p><p style=\"margin-bottom: var(--space2); padding: 0px; font-family: Shurjo, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 1.8rem; line-height: 1.67; white-space: break-spaces; color: rgb(18, 18, 18);\">ফিরোজ হোসেন ৫০ মণ ধান নিয়ে হাটে গিয়েছিলেন। প্রতি মণে ১০০ টাকা হিসেবে তিনি কম পেয়েছেন পাঁচ হাজার টাকা। তাই তাঁর মুখ মলিন, মন খারাপ।</p>', 'দাম কমল ধানের, চাল চড়াই রইল', '0', '2020-12-29', 1, 1, 1, NULL, '2020-12-29 04:35:32', '2020-12-31 00:37:21');
